import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { enableclassNameicTheme } from "../../redux/actions/themeActions";

import {
  Badge,
  Button,
  Card,
  CardBody,
  Col,
  Container,
  Media,
  Nav,
  NavItem,
  NavLink,
  Navbar,
  NavbarBrand,
  Jumbotron,
  Row
} from "reactstrap";

import {
  Box,
  Chrome,
  Code,
  DownloadCloud,
  Mail,
  Sliders,
  Smartphone
} from "react-feather";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faStar } from "@fortawesome/free-solid-svg-icons";

import screenshotDashboardDefaultLarge from "../../assets/img/screenshots/dashboard-default-large.png";
import screenshotDashboardAnalyticsLarge from "../../assets/img/screenshots/dashboard-analytics-large.png";

import screenshotDashboardDefault from "../../assets/img/screenshots/dashboard-default.png";
import screenshotDashboardAnalytics from "../../assets/img/screenshots/dashboard-analytics.png";
import screenshotDashboardEcommerce from "../../assets/img/screenshots/dashboard-e-commerce.png";
import screenshotDashboardSocial from "../../assets/img/screenshots/dashboard-social.png";
import screenshotDashboardCrypto from "../../assets/img/screenshots/dashboard-crypto.png";
import screenshotPageProjects from "../../assets/img/screenshots/pages-projects-list.png";

import screenshotThemeclassNameic from "../../assets/img/screenshots/theme-classNameic.png";
import screenshotThemeModern from "../../assets/img/screenshots/theme-modern.png";
import screenshotThemeCorporate from "../../assets/img/screenshots/theme-corporate.png";

import brandBootstrap from "../../assets/img/brands/bootstrap.svg";
import brandBootstrapB from "../../assets/img/brands/b.svg";
import brandSass from "../../assets/img/brands/sass.svg";
import brandWebpack from "../../assets/img/brands/webpack.svg";
import brandNpm from "../../assets/img/brands/npm.svg";
import brandReact from "../../assets/img/brands/react.svg";
import brandRedux from "../../assets/img/brands/redux.svg";

const Navigation = () => (
  <Navbar dark expand classNameName="navbar-landing">
    <NavbarBrand href="/">
      <Box title="AppStack" />
      AppStack
    </NavbarBrand>
    <Nav classNameName="ml-auto" navbar>

      <NavItem classNameName="d-none d-md-inline-block">
        <NavLink href="mailto:support@bootlab.io" active>
          Support
        </NavLink>
      </NavItem>
    </Nav>
    <Button
      href="https://themes.getbootstrap.com/product/appstack-react-admin-dashboard-template/"
      target="_blank"
      rel="noopener noreferrer"
      color="primary"
      classNameName="ml-2"
    >
      Create A Hub
    </Button>
  </Navbar>
);

const Intro = () => (
  <section className="pt-8 pb-11 pt-md-9 pb-md-12 py-lg-14 bg-light bg-between" >
    <div className="container">
      <div className="row justify-content-center">
        <div className="col-12 col-md-10 col-lg-7 text-center" data-aos="fade-up">


          <img src="" alt="..." className="img-fluid mb-6 d-lg-none"/>


          <h1 className="display-2 font-weight-bold">
            Designed secure.
            Built for anything.
          </h1>


          <p className="font-size-lg text-muted mb-6 mb-md-8">
            Forward thinking businesses use our cloud backup service to ensure data reliability and safety.
          </p>


          <a href="#!" className="btn btn-primary mr-1 lift">
            Get started <i className="fe fe-arrow-right ml-3"></i>
          </a>
          <a href="#!" className="btn btn-primary-soft lift">
            Learn more
          </a>

        </div>
      </div>
    </div>
  </section>
);

const Footer = () => (
  <section classNameName="py-5">
    <Container classNameName="text-center">
      <Row>
        <Col md="9" lg="8" xl="6" classNameName="mx-auto">
          <h2 classNameName="h1 mb-3">
            Join over 2,500 developers who are already working with our products
          </h2>
          <Button
            color="primary"
            size="lg"
            href="https://themes.getbootstrap.com/product/appstack-react-admin-dashboard-template/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Purchase
          </Button>
        </Col>
      </Row>
    </Container>
  </section>
);

class Landing extends React.Component {

  render() {
    return (
      <React.Fragment>
        {/* <Navigation />*/}
        <Intro />

        {/*<Footer />*/}
      </React.Fragment>
    );
  }
}

export default connect()(Landing);
